import React from 'react';
import '../styles/Home.css';

const Home = () => {
  return (
    <div className="home-container">
      <h1 className="home-title">Welcome to Home Page</h1>
      <p className="home-description">This is the home page of your application.</p>
    </div>
  );
};

export default Home;
